import React from 'react'

export default function Carousel() {
    return (
        <div className="about-carousel">
            <img className="about-carousel__img" src="./images/RollAbout2/image1.png" alt="Картинка ушла за хлебом" />
            <img className="about-carousel__img" src="./images/RollAbout2/image2.png" alt="Картинка ушла за хлебом" />
            <img className="about-carousel__img" src="./images/RollAbout2/image3.png" alt="Картинка ушла за хлебом" />
        </div>
    )
}
